import { useEffect, useState } from 'react'

const UserList = () => {
    const [user, setUser] = useState();
    const findUser = () =>
        fetch('https://jsonplaceholder.typicode.com/todos/1')
            .then(user => setUser(user))
            // .then(json => console.log(json))
    useEffect(findUser, []);
    return (
        <>
            <h1>HELLO</h1>
            <h1>{user.id}</h1>
        </>
    )
}
export default UserList;
